import { View, Text, StatusBar } from "react-native";
import React, { useState, useEffect } from "react";
import {
  NavigationContainer,
  DarkTheme,
  DefaultTheme,
} from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { EventRegister } from "react-native-event-listeners";
import theme from "../theme/theme";
import themeContext from "../theme/themeContex";
import { Colors } from "../theme/color";
import Login from "../screens/Login";
import Signup from "../screens/Signup";

import Splash from "../screens/Splash";
import Letsin from "../screens/Letsin";
import CreateAccount from "../screens/CreateAccount";
import ForgotPass from "../screens/ForgotPass";
import NewPass from "../screens/NewPass";
import Notification from "../screens/Notification";
// import Otp from '../screens/Otp';
import Introduction from "../screens/Introduction";
// import Profilefill from '../screens/Profilefill';
import Fingerprint from "../screens/Fingerprint";
import Search from "../screens/Search";
import OrderTab from "../screens/OrderTab";
import OrderTrack from "../screens/OrderTrack";
import TopUpMethod from "../screens/TopUpMethod";
import Helpcenter from "../screens/Helpcenter";
import CustomerService from "../screens/CustomerService";
import Profile2 from "../screens/Profile2";
import Profile from "../screens/Profile";
import Address from "../screens/Address";
import Notification1 from "../screens/Notification1";
import Payment from "../screens/Payment";
import NewCard from "../screens/NewCard";
import Security from "../screens/Security";
import Language from "../screens/Language";
import PrivacyPolicy from "../screens/PrivacyPolicy";
import Invited from "../screens/Invited";
import Ticket from "../screens/Ticket";
import TransactionHistory from "../screens/TransactionHistory";
import Amount from "../screens/Amount";
import MyWallet from "../screens/MyWallet";
import ConfirmPin from "../screens/ConfirmPin";
import Payment1 from "../screens/Payment1";
// import Home from '../screens/Home';

const Stack = createNativeStackNavigator();

export default function StackNavigator() {
  const [darkMode, setDarkMode] = useState(false);

  useEffect(() => {
    const listener = EventRegister.addEventListener("ChangeTheme", (data) => {
      setDarkMode(data);
      console.log(data);
    });

    return () => {
      EventRegister.removeAllListeners(listener);
    };
  }, [darkMode]);

  const [showSplashScreen, setshowSplashScreen] = useState(true);
  useEffect(() => {
    setTimeout(() => {
      setshowSplashScreen(false);
    }, 4000);
  }, []);
  return (
    <themeContext.Provider value={darkMode === true ? theme.dark : theme.light}>
      <NavigationContainer theme={darkMode === true ? DarkTheme : DefaultTheme}>
        <StatusBar
          backgroundColor={darkMode === true ? Colors.active : Colors.secondary}
          barStyle={darkMode === true ? "light-content" : "dark-content"}
          translucent={false}
        />
        <Stack.Navigator>
          {/* {showSplashScreen ? (
            <Stack.Screen
              name="Splash"
              component={Splash}
              options={{ headerShown: false }}
            />
          ) : null} */}

          {/* <Stack.Screen
            name="Introduction"
            component={Introduction}
            options={{ headerShown: false }}
          /> */}

          {/* <Stack.Screen
            name="Home"
            component={Home}
            options={{ headerShown: false }}
          /> */}
          {/* <Stack.Screen
            name="ConfirmPin"
            component={ConfirmPin}
            options={{ headerShown: false }}
          /> */}
          <Stack.Screen
            name="Payment1"
            component={Payment1}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="MyWallet"
            component={MyWallet}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Amount"
            component={Amount}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="TransactionHistory"
            component={TransactionHistory}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Ticket"
            component={Ticket}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Invited"
            component={Invited}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="PrivacyPolicy"
            component={PrivacyPolicy}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Language"
            component={Language}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Security"
            component={Security}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="NewCard"
            component={NewCard}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Payment"
            component={Payment}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Notification1"
            component={Notification1}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Address"
            component={Address}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Profile"
            component={Profile}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Profile2"
            component={Profile2}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="CustomerService"
            component={CustomerService}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Helpcenter"
            component={Helpcenter}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="TopUpMethod"
            component={TopUpMethod}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="OrderTrack"
            component={OrderTrack}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="OrderTab"
            component={OrderTab}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Search"
            component={Search}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Fingerprint"
            component={Fingerprint}
            options={{ headerShown: false }}
          />
          {/* <Stack.Screen
            name="Profilefill"
            component={Profilefill}
            options={{ headerShown: false }}
          /> */}
          {/* <Stack.Screen
            name="Otp"
            component={Otp}
            options={{ headerShown: false }}
          /> */}
          <Stack.Screen
            name="Notification"
            component={Notification}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="NewPass"
            component={NewPass}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="ForgotPass"
            component={ForgotPass}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="CreateAccount"
            component={CreateAccount}
            options={{ headerShown: false }}
          />

          <Stack.Screen
            name="Letsin"
            component={Letsin}
            options={{ headerShown: false }}
          />
          <Stack.Screen
            name="Login"
            component={Login}
            options={{ headerShown: false }}
          />
        </Stack.Navigator>
      </NavigationContainer>
    </themeContext.Provider>
  );
}
